import React, { Component } from 'react';
import api from './services/api';
import ChartUsuarioMes from './components/ChartUsuarioMes';

export default class App extends Component {
  constructor(props){
    super(props);
    this.state = {
      users: [],
      weddings: [],
      appointments: [],
      invoices: []
    }
  }

  componentDidMount(){
      let users = api.get("/user").then(resp => resp.data);
    this.setState({
      users: users
    });
  }

  render () {
    const { users } = this.state;
    return (
      <div className="App">
        <ChartUsuarioMes users={users} />
      </div>
    );
  }
}
